                        render={({ match: { url } }) => (
                                <>
                                  <Route path={`${url}/`} component={Backend} exact />
                                  <Route path={`${url}/forgot-password`} component={forgotPassword} />

                                </>
                              )}             
                      />
                </Switch>
        </Router>
        )
}

export default App;
